import React from "react";
import styled from "styled-components";
import { PrivateQuiz } from "../../../models/PrivateQuiz";

interface Props {
  myQuizzes: PrivateQuiz[];
}

export const QuizOverview: React.FC<Props> = ({ myQuizzes }) => {
  return (
    <>
      <h2>My quizzes</h2>
      {myQuizzes.map(quiz => (
        <h5>{quiz.title}</h5>
      ))}
    </>
  );
};
